import React from 'react';

export default function Card (props){

    const curCard = props.card.num;

    return (
        <div className="card">
            <div className="card-top">
                <div>{curCard}</div>
                <div>{props.card.suit}</div>
            </div>
            <div className="card-bottom">
                <div>{curCard}</div>
                <div>{props.card.suit}</div>
            </div>
        </div>
    )
}
